import React, { useState } from 'react';
import { Container, Typography, Box, Button, TextField, LinearProgress, Dialog, DialogActions, DialogContent, DialogTitle, IconButton, MenuItem, Select, InputLabel, FormControl } from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';

const UploadDataPage = ({ open, onClose }) => {
    const [file, setFile] = useState(null);
    const [uploading, setUploading] = useState(false);
    const [uploadProgress, setUploadProgress] = useState(0);
    const [url, setUrl] = useState('');
    const [source, setSource] = useState('');

    const handleFileChange = (e) => {
        if (e.target.files.length > 0) {
            setFile(e.target.files[0]);
        }
    };

    const handleUrlChange = (e) => {
        setUrl(e.target.value);
    };

    const handleSourceChange = (e) => {
        setSource(e.target.value);
    };

    const handleUpload = async () => {
        if (!file && !url) {
            alert('Please select a file or enter a URL.');
            return;
        }

        setUploading(true);

        // Simulate file upload progress
        const uploadInterval = setInterval(() => {
            setUploadProgress((prev) => {
                if (prev >= 100) {
                    clearInterval(uploadInterval);
                    setUploading(false);
                    return 100;
                }
                return prev + 10;
            });
        }, 500);

        // Replace with your actual upload logic
        try {
            // Example upload logic:
            // await uploadFile(file, url, source);
            // Handle successful upload
            alert('File or URL uploaded successfully!');
            onClose();
        } catch (error) {
            // Handle upload error
            alert('Error uploading file or URL.');
        } finally {
            setUploading(false);
        }
    };

    return (
        <Dialog
            open={open}
            onClose={onClose}
            maxWidth="sm"
            fullWidth
        >
            <DialogTitle>
                Upload New Data
                <IconButton
                    edge="end"
                    color="inherit"
                    onClick={onClose}
                    aria-label="close"
                    sx={{ position: 'absolute', right: 8, top: 8 }}
                >
                    <CloseIcon />
                </IconButton>
            </DialogTitle>
            <DialogContent>
                <Box sx={{ mb: 2 }}>
                    <TextField
                        label="URL"
                        variant="outlined"
                        fullWidth
                        value={url}
                        onChange={handleUrlChange}
                        sx={{ mb: 2 }}
                    />
                    <FormControl fullWidth variant="outlined" sx={{ mb: 2 }}>
                        <InputLabel>Source</InputLabel>
                        <Select
                            value={source}
                            onChange={handleSourceChange}
                            label="Source"
                        >
                            <MenuItem value="Website">Website</MenuItem>
                            <MenuItem value="Notion">Notion</MenuItem>
                            <MenuItem value="Confluence">Confluence</MenuItem>
                            <MenuItem value="Document">Document</MenuItem>
                        </Select>
                    </FormControl>
                    <input
                        type="file"
                        onChange={handleFileChange}
                        accept=".csv,.json" // Adjust as needed
                    />
                </Box>
            </DialogContent>
            <DialogActions>
                <Button
                    variant="contained"
                    color="primary"
                    onClick={handleUpload}
                    disabled={uploading}
                >
                    Upload
                </Button>
            </DialogActions>
            {uploading && <LinearProgress sx={{ mt: 2 }} variant="determinate" value={uploadProgress} />}
        </Dialog>
    );
};

export default UploadDataPage;
